import { Container,Button } from "reactstrap";
const UserExist = () => {
  return (
    <div>
      <Container className="m-4 align-">
        <Button color="primary">Login</Button>{" "}
        <Button color="secondary">SignUp</Button>{" "}
      </Container>{" "}
    </div>
  );
};

export default UserExist;
